import React from "react";
import { 
    Container,
    Grid,
    Paper
 } from "@material-ui/core"

class GridLayout extends React.PureComponent {
    render() {
        return (
            <div className = "grid">
                <Grid container spacing = {20}>
                    <Grid item xs = {3}>
                        <Paper >xs=3</Paper>
                    </Grid>
                    <Grid item xs = {3}>
                        <Paper >xs=3</Paper>
                    </Grid>
                    <Grid item xs = {3}>
                        <Paper >xs=3</Paper>
                    </Grid>
                </Grid>
            </div>
        )
    }
}

export default GridLayout;
